import React from 'react';
import {
    StyleSheet,
    Text,
    View,
} from 'react-native';

const Kichwa = (props) =>{
    return(
        <View 
        style = {styles.View}
        >
            <Text style = {styles.text}
            >
                Kichwa cha Mafunzo ya React Native
            </Text>
        </View>
    )
}
const styles = StyleSheet.create({
    view: {
        width:'100%',
        height: 50,
        backgroundColor: '#00f',
        justifyContent: 'center',
        alignItems: 'center',
    },
    text:{
        fontSize: 25,
        fontWeight:'bold',
        color:'#ffffff'
    }
})

export default Kichwa;
